import React from 'react'
import './Getsupport.css'
export default function Getsupport() {
    const data = [
        {
            id:"Indore",
        },
        {
            id:"Bhopal",
        },
        {
            id:"ujjain",
        }
    ]
  return (
    <div>
      <h1 className='logos1'>Our Centers</h1>
      <div className='cardpositioner'>
      <div className='cards'>
        <div className='cardname'>{data[0].id}</div>
      </div>
      <div className='cards'>
      <div className='cardname'>{data[1].id}</div>
      </div>
      <div className='cards'>
      <div className='cardname'>{data[2].id}</div>
      </div>
      </div>
    </div>
  )
}
